const loginComponent = () => {

  return (

   <div id="login">
      <input type="text" id="email" placeholder="User Id" onChange = {(evt) => {this.props.state.userId = evt.target.value}}/>
      <input type="password" id="password" placeholder="Password" onChange = {(evt) => {this.props.state.password = evt.target.value}}/>
      <button id="send" onClick = {() => this.props.onClick}>Send</button>
</div>
  );
}


export default loginComponent;
